import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

// Importing Admin Pages
import IssueResolution from './admin/pages/IssueResolution';
import LogoutAdmin from './admin/pages/Logout';
import ReportGeneration from './admin/pages/ReportGeneration';
import Settings from './admin/pages/Settings';
import SystemMonitoring from './admin/pages/SystemMonitoring';
import UserManagement from './admin/pages/UserManagement';

// Importing Employee Pages
import DashboardEmployee from './employee/pages/Dashboard';
import LearningDevelopment from './employee/pages/LearningDevelopment';
import LogoutEmployee from './employee/pages/Logout';
import RequestLearningPlan from './employee/pages/RequestLearningPlan';
import RequestQuestionBank from './employee/pages/RequestQuestionBank';
import SelfAssessment from './employee/pages/SelfAssessment';
import SubmitFeedback from './employee/pages/SubmitFeedback';

// Importing Trainer Pages
import Curriculum from './trainer/pages/Curriculum';
import DashboardTrainer from './trainer/pages/Dashboard';
import DownloadQuestionBankPage from './trainer/pages/DownloadQuestionBankPage';
import FeedbackPage from './trainer/pages/FeedbackPage';
import GenerateQuestionBankPage from './trainer/pages/GenerateQuestionBankPage';
import ReviewAndEditQuestionBankPage from './trainer/pages/ReviewAndEditQuestionBankPage';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          {/* Admin Routes */}
          <Route path="/admin/issue-resolution" component={IssueResolution} />
          <Route path="/admin/logout" component={LogoutAdmin} />
          <Route path="/admin/report-generation" component={ReportGeneration} />
          <Route path="/admin/settings" component={Settings} />
          <Route path="/admin/system-monitoring" component={SystemMonitoring} />
          <Route path="/admin/user-management" component={UserManagement} />

          {/* Employee Routes */}
          <Route path="/employee/dashboard" component={DashboardEmployee} />
          <Route path="/employee/learning-development" component={LearningDevelopment} />
          <Route path="/employee/logout" component={LogoutEmployee} />
          <Route path="/employee/request-learning-plan" component={RequestLearningPlan} />
          <Route path="/employee/request-question-bank" component={RequestQuestionBank} />
          <Route path="/employee/self-assessment" component={SelfAssessment} />
          <Route path="/employee/submit-feedback" component={SubmitFeedback} />

          {/* Trainer Routes */}
          <Route path="/trainer/curriculum" component={Curriculum} />
          <Route path="/trainer/dashboard" component={DashboardTrainer} />
          <Route path="/trainer/download-question-bank" component={DownloadQuestionBankPage} />
          <Route path="/trainer/feedback" component={FeedbackPage} />
          <Route path="/trainer/generate-question-bank" component={GenerateQuestionBankPage} />
          <Route path="/trainer/review-edit-question-bank" component={ReviewAndEditQuestionBankPage} />

          {/* Default Route */}
          <Route path="/" exact component={DashboardEmployee} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
